// JavaScript Document

function oneStart(menu){
	
	//alert(menu);
	var osConfig={
		"name":"oneStart",
		"baseCss":{
			"right":"20px"
		},
		"btnCss":{
			"right":"4px"
		},
		"debug":"0"
	};
	
	$("body").prepend($('<div id="oneStartBG" style="display:none;"></div><div id="oneStartDiv"><div class="btnImg"></div><ul class="oneStartMenu"></ul><div class="btnDiv"></div></div>'));
	//$("head").prepend($('<link rel="stylesheet" href="../css/startMenu.css" />'));
	
	config=osConfig;
	oneStartObj=$("#oneStartDiv");	
	oneStartDomObj = document.getElementById('oneStartDiv'); 
	oneStartImgObj=$("#oneStartDiv .btnImg");
	oneStartMenu=$("#oneStartDiv ul");
	oneStartBG=$("#oneStartBG");
	var baseDivCSS={
		"right":config["baseCss"]["right"]
	};
	var baseBtnCSS={
		"right":config["btnCss"]["right"]
	};
	
	oneStartObj.css(baseDivCSS);
	oneStartImgObj.css(baseBtnCSS);
	var onoffStat=0;//按钮状态码[0:收起,1:展开]
	var lastx=-1;//储存按下时的鼠标x位置
	var lasty=-1;//储存按下时的鼠标y位置
	var nowx=-1;//储存当时的鼠标x位置
	var nowy=-1;//储存当时的鼠标y位置
	var LEFT=0;//OS在左边
	var RIGHT=1;//OS在右边
	var currentPosition=RIGHT;
	
	var touching=false;
	var into=false;
	
	function openMenu(){
		oneStartObj.attr("class","active");
		oneStartImgObj.attr("class","btnImg active");
		onoffStat=1;
		setTimeout('oneStartMenu.css("opacity","1");',200);
		oneStartMenu.attr("class","show");
		oneStartBG.css("display","block");
		oneStartBG.css("opacity","0.5");
	}
	function closeMenu(){
		oneStartObj.removeAttr("class");
		oneStartImgObj.attr("class","btnImg");
		onoffStat=0;
		oneStartMenu.css("opacity","0");
		oneStartMenu.removeAttr("class");
		oneStartBG.css("opacity","0");
		setTimeout('oneStartBG.css("display","none");',300);
	}
	function moveToLeft(){
		oneStartObj.css("right","calc(100vw - 117px)");
		currentPosition=LEFT;
		setTimeout('updataCSS(0)',500);
		lastx=-1;
		lasty=-1;
		setCookie("currentPosition","left",30);
	}
	function moveToRight(){
		oneStartObj.css("left","calc(100vw - 117px)");
		currentPosition=RIGHT;
		setTimeout('updataCSS(1)',500);
		lastx=-1;
		lasty=-1;
		setCookie("currentPosition","right",30);
	}
	oneStartDomObj.addEventListener('touchstart', function(event) { 
		touching=true;
		into=true;
		lastx=event.touches[0].clientX;
		lasty=event.touches[0].clientY;
		nowx=lastx;
		nowy=lasty;
		if(config["debug"]=="1"){
			console.log("--------调试数据--------");
			console.log("当前触摸开始,位置为:["+lastx+","+lasty+"]");
		}
	}, false);
	oneStartDomObj.addEventListener('mousedown', function(event) { 
		if(touching)return;
		into=true;
		lastx=event.clientX;
		lasty=event.clientY;
		if(config["debug"]=="1"){
			console.log("--------调试数据--------");
			console.log("当前鼠标按下,位置为:["+lastx+","+lasty+"]");
		}
	}, false);
	oneStartDomObj.addEventListener('touchmove', function(event) { 
		
		nowx=event.touches[0].clientX;
		nowy=event.touches[0].clientY;
	}, false);
	document.addEventListener('mouseup', function(event) { 
		if(touching)return;
		if(into)clearSlct();
		nowx=event.clientX;
		nowy=event.clientY;
		if(config["debug"]=="1"){
			console.log("--------调试数据--------");
			console.log("当前鼠标松开,位置为:["+nowx+","+nowy+"]");
		}
		checkMove();
		into=false;
	}, false);
	oneStartDomObj.addEventListener('touchend', function(event) { 
		
		if(config["debug"]=="1"){
			console.log("--------调试数据--------");
			console.log("当前触摸结束,最后位置为:["+nowx+","+nowy+"]");
		}
		checkMove();
		touching=false;
		into=false;
	}, false);

	oneStartImgObj.click(function(){
		if(onoffStat==0){
			openMenu();
		}else if(onoffStat==1){
			closeMenu();
		}
		nowx=-1;
		nowy=-1;
	});

	
	
	function checkMove(){
		if((lastx==-1&&lasty==-1)||(nowx==-1&&nowy==-1))
			return;
		if(lastx-nowx>100)
		{
			moveToLeft();
		}
		else if(lastx-nowx<-100)
		{
			moveToRight();
		}else if(lasty-nowy>100)
			gotoTop();
	}
	
	var oneLiTemp='<li style="background-image:url({{icon}});" onclick="{{code}}">{{name}}{{addition}}</li>';
	var temp="";
	var lis="";
	for(var i=0;i<menu.length;i++)
	{
		temp=oneLiTemp;
		temp=temp.replace("{{icon}}",menu[i]["icon"]);
		temp=temp.replace("{{name}}",menu[i]["name"]);
		if(i==0)
			temp=temp.replace("{{addition}}",menu[0]["addition"]);
		else
			temp=temp.replace("{{addition}}","");
		temp=temp.replace("{{code}}","osMenu["+i+"].clickF();");
		lis+=temp;

	}
	oneStartMenu.html("<div>"+lis+"</div>");
	oneStartMenuLis=$("#oneStartDiv ul div");
	var pos=getCookie("currentPosition");
	if(pos=="left"){
		moveToLeft();
	}
	else if(pos=="right"){
		moveToRight();
	}
	else{}
}

//更新CSS,以便在左右的时候菜单能正确展开
function updataCSS(where){
	if(where==0){//左边的情况
		oneStartObj.removeAttr("style");
		oneStartObj.css("left","20px");
		oneStartImgObj.removeAttr("style");
		oneStartImgObj.css("left","4px");	
	}else{//右边以及异常情况
		oneStartObj.removeAttr("style");
		oneStartObj.css("right","20px");
		oneStartImgObj.removeAttr("style");
		oneStartImgObj.css("right","4px");	
	}
}

function gotoTop(acceleration,stime) {
   acceleration = acceleration || 0.1;
   stime = stime || 10;
   var x1 = 0;
   var y1 = 0;
   var x2 = 0;
   var y2 = 0;
   var x3 = 0;
   var y3 = 0; 
   if (document.documentElement) {
       x1 = document.documentElement.scrollLeft || 0;
       y1 = document.documentElement.scrollTop || 0;
   }
   if (document.body) {
       x2 = document.body.scrollLeft || 0;
       y2 = document.body.scrollTop || 0;
   }
   var x3 = window.scrollX || 0;
   var y3 = window.scrollY || 0;
 
   // 滚动条到页面顶部的水平距离
   var x = Math.max(x1, Math.max(x2, x3));
   // 滚动条到页面顶部的垂直距离
   var y = Math.max(y1, Math.max(y2, y3));
 
   // 滚动距离 = 目前距离 / 速度, 因为距离原来越小, 速度是大于 1 的数, 所以滚动距离会越来越小
   var speeding = 1 + acceleration;
   window.scrollTo(Math.floor(x / speeding), Math.floor(y / speeding));
 
   // 如果距离不为零, 继续调用函数
   if(x > 0 || y > 0) {
       var run = "gotoTop(" + acceleration + ", " + stime + ")";
       window.setTimeout(run, stime);
   }
}

function getCookie(c_name)
{
if (document.cookie.length>0)
  {
  c_start=document.cookie.indexOf(c_name + "=")
  if (c_start!=-1)
    { 
    c_start=c_start + c_name.length+1 
    c_end=document.cookie.indexOf(";",c_start)
    if (c_end==-1) c_end=document.cookie.length
    return unescape(document.cookie.substring(c_start,c_end))
    } 
  }
return ""
}

function setCookie(c_name,value,expiredays)
{
var exdate=new Date()
exdate.setDate(exdate.getDate()+expiredays)
document.cookie=c_name+ "=" +escape(value)+
((expiredays==null) ? "" : ";expires="+exdate.toGMTString())
}

var clearSlct= "getSelection" in window ? function(){
            window.getSelection().removeAllRanges();
        } : function(){
            document.selection.empty();
        };
		
		
